INSERT INTO `z_forum` (`id`, `first_post`, `last_post`, `section`, `replies`, `views`, `author_aid`, `author_guid`, `post_text`, `post_topic`, `post_smile`, `post_date`, `last_edit_aid`, `edit_date`, `post_ip`, `icon_id`, `post_icon_id`) VALUES
(15, 15, 1571969224, 1, 0, 0, 3, 7, '<p style=\"text-align:center\"><span style=\"font-family:courier new,courier; font-size:xx-large\"><strong><span style=\"color:#ff0000\"><img alt=\"laugh\" height=\"23\" src=\"https://clevert.com.br/lib/ckeditor/plugins/smiley/images/teeth_smile.png\" title=\"laugh\" width=\"23\" />&nbsp;</span><span style=\"color:#800000\">Classic Yurots Tibinha</span><span style=\"color:#ff0000\">&nbsp;<img alt=\"laugh\" height=\"23\" src=\"https://clevert.com.br/lib/ckeditor/plugins/smiley/images/teeth_smile.png\" title=\"laugh\" width=\"23\" /></span></strong></span></p>\n\n<p style=\"text-align:center\"><span style=\"color:#993300; font-family:courier new,courier; font-size:x-large\">&nbsp;<strong>Atualiza&ccedil;&otilde;es Customs</strong></span></p>\n\n<p style=\"text-align:center\"><span style=\"color:#993300; font-family:courier new,courier; font-size:x-large\">&nbsp;No&nbsp;Classic Yurots,&nbsp;foram feitas algumas modifica&ccedil;&otilde;es e adi&ccedil;&otilde;es de f&oacute;rmulas e itens.</span><br />\n<span style=\"color:#993300; font-family:courier new,courier; font-size:x-large\">O objetivo &eacute; melhorar a experi&ecirc;ncia dos jogadores e faz&ecirc;-los lembrar um pouco dos tempos de ouro.</span><br />\n<span style=\"color:#993300; font-family:courier new,courier; font-size:x-large\">Algumas modifica&ccedil;&otilde;es foram implementadas apenas para determinada classe, afim de balancear o PVP.</span></p>', 'Tibinha', 0, 1571969224, 0, 0, '200.53.17.221', 4, 0),
(16, 16, 1683034212, 1, 0, 0, 3, 7, '<p style=\"text-align:center\"><span style=\"color:#800000; font-family:courier new,courier; font-size:xx-large\"><em><span style=\"color:#800000; font-family:courier new,courier\"><strong><img alt=\"surprise\" height=\"23\" src=\"https://clevert.com.br/lib/ckeditor/plugins/smiley/images/omg_smile.png\" title=\"surprise\" width=\"23\" />Torneio Pix&nbsp;</strong></span></em><img alt=\"yes\" height=\"23\" src=\"https://clevert.com.br/lib/ckeditor/plugins/smiley/images/thumbs_up.png\" title=\"yes\" width=\"23\" /></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#800000; font-family:courier new,courier; font-size:large\">Estamos organizando um torneio di&aacute;rio para os nossos jogadores que premiar&aacute; o jogador que acumular a maior quantidade de EXP em um &uacute;nico dia com um pr&ecirc;mio em dinheiro de R$ 10,00 via PIX.</span><br />\r\n<br />\r\n<u><span style=\"color:#800000; font-family:courier new,courier; font-size:large\">Para participar, os jogadores precisam atender aos seguintes crit&eacute;rios:</span></u></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams; Estar no n&iacute;vel 460 ou acima;</span><br />\r\n<span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams; Estar jogando durante o per&iacute;odo de 24 horas que come&ccedil;a a partir do save global;</span><br />\r\n<span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams; Acumular a maior quantidade de EXP durante este per&iacute;odo.</span><br />\r\n<span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams;&nbsp;O uso de BOTs &eacute; permitido, o que significa que os jogadores podem automatizar o jogo para obter mais EXP em um per&iacute;odo de tempo menor.</span><br />\r\n<span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams;&nbsp;O pagamento do pr&ecirc;mio ser&aacute; feito sempre um dia ap&oacute;s a soma da EXP e estar&aacute; vis&iacute;vel na p&aacute;gina do POWERGAMES. No entanto, para que o torneio seja v&aacute;lido, &eacute; necess&aacute;rio que pelo menos 30 jogadores estejam participando.</span><br />\r\n<span style=\"color:#800000; font-family:courier new,courier; font-size:large\">&diams;&nbsp;Se voc&ecirc; est&aacute; abaixo do n&iacute;vel 459, infelizmente voc&ecirc; n&atilde;o pode participar. Mas se voc&ecirc; atender a todos os crit&eacute;rios acima, junte-se a n&oacute;s para competir pelo pr&ecirc;mio di&aacute;rio em nosso&nbsp;Torneio&nbsp;Pix!</span></p>', 'Online', 0, 1683034212, 0, 0, '187.87.190.231', 1, 0),
(17, 17, 1683034233, 1, 0, 0, 3, 7, '<p style=\"text-align:center\"><span style=\"font-family:courier new,courier,monospace\"><span style=\"font-size:36px\"><em><strong><span style=\"color:#800000\">Classic Yurots Tibinha</span></strong></em></span></span><br />\n<span style=\"font-family:courier new,courier,monospace\"><span style=\"font-size:small\"><em><img alt=\"\" height=\"167\" src=\"https://i.imgur.com/5YsuRcu.jpg\" width=\"361\" /></em></span></span></p>\n\n<p><span style=\"font-family:courier new,courier,monospace\"><a href=\"https://i.imgur.com/aAT3njD.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"aAT3njD.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/aAT3njD.gif.ec49894e974a0c428337b85e4a69b3ba.gif\" width=\"32\" /></a>&nbsp; &nbsp;<strong>Ultimate Healing Rune&nbsp;=&nbsp;</strong>F&oacute;rmula da vers&atilde;o 7.6.<br />\n<strong>&nbsp; &nbsp; &nbsp; &nbsp;(Esta f&oacute;rmula funciona apenas para knights. Demais voca&ccedil;&otilde;es, a f&oacute;rmula continua da vers&atilde;o 8.6)</strong>.<br />\n<a href=\"https://i.imgur.com/41LuaIO.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"41LuaIO.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/41LuaIO.gif.446b19eb2a767d203551d0673f7e6669.gif\" width=\"32\" /></a>&nbsp; <strong>Enchanted Staff&nbsp;=&nbsp;</strong>Ao utilizar a magia &#39;Exeta Vis&#39; segurando uma &#39;Staff&#39;, transformar&aacute; o item em uma wand, &#39;Enchanted Staff&#39;.<br />\n<strong>&nbsp;(Mages podem utilizar esta magia, a wand possui dano de energy: 65~90 - Dura&ccedil;&atilde;o: 10 minutos)</strong>.</span><br />\n<span style=\"font-family:courier new,courier,monospace\"><a href=\"https://i.imgur.com/AAyPYdd.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"AAyPYdd.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/AAyPYdd.gif.d35005e274527ba42e5292d718375e70.gif\" width=\"32\" /></a>&nbsp;&nbsp;<strong>Animate Dead Rune&nbsp;</strong>=&nbsp;Ao utilizar em um corpse, sumona um &#39;Animated Skeleton&#39;.<br />\n<strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (Esses monstros causam um dano muito alto de death por&eacute;m, s&atilde;o muito fr&aacute;geis)</strong>.<br />\n<a href=\"https://i.imgur.com/v6zWfNs.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"v6zWfNs.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/v6zWfNs.gif.df1002b0fe07aad118992512c18b6e3d.gif\" width=\"32\" /></a>&nbsp; <strong><strong>Staff Of Destruction</strong></strong>&nbsp;=&nbsp;Esse item pode ser obtido ap&oacute;s finalizar a&nbsp;&#39;Pits of Inferno Quest&#39;.<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>(Wand apenas para mages com dano de energy: 90~140)</strong>.<br />\n<a href=\"https://i.imgur.com/rCLeAQZ.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"rCLeAQZ.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/rCLeAQZ.gif.dfab35df4044259d6e8fcc833796396f.gif\" width=\"32\" /></a>&nbsp; <strong>Diamond Arrows&nbsp;</strong>=&nbsp;Todos os Paladins podem conjurar 100 deste item utilizando a magia&nbsp;&#39;exevo gran con hur&#39;.&nbsp;</span><span style=\"font-family:courier new,courier,monospace\"><strong>(Requer level: 150, mana: 1000, o item dura 10 minutos - ATK: 37, HitChance: 91,&nbsp;ataca uma &aacute;rea de 21 SQM&#39;s com atk f&iacute;sico)</strong>.<br />\n<a href=\"https://i.imgur.com/ln2fBxP.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"ln2fBxP.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/ln2fBxP.gif.c20dd6a17ae91db5f2c19f18712721bb.gif\" width=\"32\" /></a>&nbsp; <strong>Crystalline Arrows</strong>&nbsp;=&nbsp;Voc&ecirc; poder&aacute; obter este item em troca de um &#39;Soul Orb&#39; no npc<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#39;A Sweaty Cyclops&#39;.&nbsp;<strong>(Atk: 65, HitChance: 85)</strong>.<br />\n<a href=\"https://i.imgur.com/toKjpZV.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"toKjpZV.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/toKjpZV.gif.88aeba21b5b7dc8a229a611e573d74c6.gif\" width=\"32\" /></a>&nbsp; <strong>Infernal Bolts&nbsp;</strong>=&nbsp;Voc&ecirc; poder&aacute; obter este item em troca de um &#39;Soul Orb&#39; no npc<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#39;A Sweaty Cyclops&#39;.&nbsp;<strong>(Atk: 72, HitChance: 75)</strong>.<br />\n<a href=\"https://i.imgur.com/mCHS7Gx.gif\" rel=\"external noopener\" target=\"_blank\"><img alt=\"mCHS7Gx.gif\" height=\"32\" src=\"https://tibiaking.com/uploads/imageproxy/mCHS7Gx.gif.dceade405a509ff2762010ec8dcb3c2d.gif\" width=\"32\" /></a>&nbsp; <strong>Great Holy Rune</strong>&nbsp;=&nbsp;Uma runa apenas para paladins, causa dano de Holy em uma &aacute;rea de<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;37 SQM&#39;s.&nbsp;<strong>(Possui um dano um pouco inferior que uma gfb. Apenas paladins podem usar)</strong>.</span></p>\n<img src=\"https://i.imgur.com/WLjuTuC.png\" width=\"700\" height=\"160\">', 'Bem Vindo', 0, 1683034233, 0, 0, '187.87.190.231', 1, 0);
