(21, 1586100037, 3, 2, 'Adicionado novo Continente Gengia dentro do templo de Yurots, contendo Hydras, Dl\'s, Demon\'s, Behemoths , Dragons, Tumbas, Draken, Frost e muito mais tudo caminhando, inicialmente temos 38 cassas para alugar naquele continente.', 0),
