(32, 1683035816, 3, 0, 'OlÃ¡! Ã‰ um prazer recebÃª-lo no Tibinha, um servidor personalizado repleto de desafios e emoÃ§Ãµes para os jogadores explorarem. Nossa comunidade Ã© formada por jogadores apaixonados e dedicados que estÃ£o sempre procurando novas maneiras de tornar o jogo mais interessante e envolvente. Aqui, vocÃª encontrarÃ¡ recursos exclusivos e conteÃºdo personalizado que tornarÃ£o sua experiÃªncia de jogo Ãºnica e emocionante. Junte-se a nÃ³s e embarque em uma jornada inesquecÃ­vel no Tibinha!', 0),
(33, 1683036117, 3, 4, 'VocÃª estÃ¡ pronto para uma aventura emocionante? Aqui no nosso servidor, a experiÃªncia de jogo Ã© cuidadosamente equilibrada para que vocÃª possa progredir rapidamente atÃ© o nÃ­vel 150, o nÃ­vel ideal para as batalhas na versÃ£o 8.60. Mas nÃ£o se preocupe, a diversÃ£o nÃ£o para por aÃ­. Ã€ medida que vocÃª avanÃ§a, a dificuldade aumenta gradualmente, permitindo que vocÃª se concentre no RPG e no status dentro do servidor. Ã‰ hora de mostrar suas habilidades e se destacar no mundo de Tibinha!', 0),
(34, 1683036153, 3, 2, 'Potes, Runas e Arrow\'s INFINITOS!!! Diferente do que o normal, fazendo que vocÃª possa fica milhares de horas em hunt. Note que Diamond Arrow nao  infinita, sendo que mesma leva 1 minuto para ser produzida sempre 100, ao gasto 1000 de mana.', 0),
